import s from './Info.module.css';
import Preloader from "../../common/preloader/preloader";

const Info = (props) => {
    if(!props.profile) {
        return <Preloader />
    }
    return (
        <div className={s.info}>
            <div className={s.photo}>
                <img alt='img' src='/img/freddie2.jpeg'/>
            </div>

            <div className={s.photo}>
                <img alt='img' src={props.profile.photos.small}/>
            </div>

            <div className={s.photoInfo}>
                <h3>Freddie Mercury</h3>

                <p>
                    <span className={s.userInfo}>Born:</span> 2 September 1946<br/>
                    <span className={s.userInfo}>City:</span> London<br/>
                    <span className={s.userInfo}>Nationality:</span> British<br/>
                    <span className={s.userInfo}>Occupation:</span> singer, songwriter and record producer
                </p>
            </div>
        </div>
    )
}

export default Info;
